import React from 'react';
import './IconBox.css'

const IconBox = (props) => {
    return (

        <>
            {props.otherIcon ? (
                <div className="icon_box">
                    {props.icon}
                    <button>Ask</button>
                </div>
            ) : <div className="icon_box">{props.icon}</div>
            }
        </>
    );
};

export default IconBox;
